script: |
  super -f text -I q5289.spq | sort > q5289.out

inputs:
  - name: q5289.spq
    data: |
      SELECT DISTINCT col0 / + 12 col1 FROM tab0 (FORMAT parquet) WHERE ( col1 * + ( + - 80 ) + + + col2 * - 90 - + col1 ) < + ( + col0 ) + - col1;
  - name: tab0

outputs:
  - name: q5289.out
    data: |
      1
      7
      8
